import styles from './App.module.css';
import useGames from "./hooks/useGames.js";
import { useEffect, useState } from "react";
import imdb from "./assets/imdb.png";
import SearchBar from "./components/SearchBar.jsx";
import Home from "./pages/Home.jsx";
import GameDetail from "./pages/GameDetail.jsx";
import { BrowserRouter as Router, Route, Switch } from "reactor-router-dom";

function App() {
	useEffect(() => {
		document.title = "IMDb Top 60 Video Games Ezra";
	});
  return (
	  <>
	  <div className={styles.all}>
	  <div className={styles.navigation}><SearchBar /> </div>
	  <div className={styles.main}>
	  Main body
	  <Router>
	  <Switch>
	  	<Route exact path="/" components={Home} />
	  	<Route path="/:id" components={GameDetail} />
	  </Switch>
	  </Router>
	  </div>
	  <div className={styles.side}>more to explore</div>
	  </div>
	  </>
  );
}

export default App;
